async function fetchUserData() {
    // Simulate fetching user data from a backend server or local storage
    // Replace this with actual logic to fetch user data
    return new Promise((resolve, reject) => {
        // Simulated delay to mimic asynchronous fetch
        setTimeout(() => {
            const userData = { id: 1, username: 'exampleUser', roles: ['admin', 'manager'] }; // Example user data
            resolve(userData);
        }, 1000); // Simulated delay of 1 second
    });
}

export { fetchUserData };
